import{_ as l,c as a,a3 as i,o as t}from"./chunks/framework.BP-s_cs7.js";const m=JSON.parse('{"title":"建筑师","description":"","frontmatter":{},"headers":[],"relativePath":"zh-CN/docs/guide/title/build.md","filePath":"zh-CN/docs/guide/title/build.md","lastUpdated":1726052843000}'),o={name:"zh-CN/docs/guide/title/build.md"};function r(s,e,n,d,c,h){return t(),a("div",null,e[0]||(e[0]=[i('<h1 id="建筑师" tabindex="-1">建筑师 <a class="header-anchor" href="#建筑师" aria-label="Permalink to &quot;建筑师&quot;">​</a></h1><ul><li>在 qq 群内@管理后，如果管理看到会去你的领地给你审核。</li><li>如果你的建筑足够出色就不用从小师开始。</li><li>获得称号的方法：建筑通过审核后，管理会下发称号可以进入菜单查看（因为是人工发放称号，所以不会及时给到称号，没拿到称号也不要着急，等管理上线会下发的）。</li></ul><h3 id="建筑小师" tabindex="-1">建筑小师 <a class="header-anchor" href="#建筑小师" aria-label="Permalink to &quot;建筑小师&quot;">​</a></h3><ul><li>有明确的建筑主题。</li><li>是个能让人看，并且感觉有技术含量的建筑。</li><li>建筑大小无规定，要有内饰点缀。 <strong><em>【可非原创，作品必须单人完成】</em></strong></li></ul><h3 id="建筑中师" tabindex="-1">建筑中师 <a class="header-anchor" href="#建筑中师" aria-label="Permalink to &quot;建筑中师&quot;">​</a></h3><ul><li>有明确的建筑主题。</li><li>有外饰和内饰。</li><li>建筑大小按照你所建筑的主题定 <strong><em>(如果足够精美，大小可酌情考虑)</em></strong>。</li><li>内饰相对精美不能太拥挤。</li><li>建筑也可是一个群（比如一个城镇等等）。 <strong><em>【半原创或者原创，作品必须单人完成】</em></strong></li></ul><h3 id="建筑大师" tabindex="-1">建筑大师 <a class="header-anchor" href="#建筑大师" aria-label="Permalink to &quot;建筑大师&quot;">​</a></h3><ul><li>有明确的建筑主题。</li><li>外表细腻精致，观赏无死角，建筑大小**<em>（最少 <code>50*50</code> ）(足够精美可酌情考虑)</em>**。</li><li>有文字上的设定。</li><li>内饰精美细腻符合建筑特点，要有布景和外饰。 <strong><em>【可半原创或者原创，作品必须单人完成】</em></strong></li></ul><h3 id="建筑天师" tabindex="-1">建筑天师 <a class="header-anchor" href="#建筑天师" aria-label="Permalink to &quot;建筑天师&quot;">​</a></h3><ul><li>有明确的建筑主题。</li><li>建筑大小**<em>（最少 <code>80*80</code> 只能比这个大不能比这个小）</em>**。</li><li>有文字上的设定。</li><li>内饰精美夺人眼球，点缀丰富。</li><li>必须是建筑群**<em>（如一个城镇等等）</em>**，观赏无死角。</li><li>建筑的精美程度要比上乘更好。 <strong><em>【必须原创，作品必须单人完成】</em></strong></li></ul><hr><div class="danger custom-block"><p class="custom-block-title">注意</p><p><strong>像素画不能审核建筑师</strong></p></div><h2 id="特殊建筑称号" tabindex="-1">特殊建筑称号 <a class="header-anchor" href="#特殊建筑称号" aria-label="Permalink to &quot;特殊建筑称号&quot;">​</a></h2><h3 id="像素画带师" tabindex="-1">像素画带师 <a class="header-anchor" href="#像素画带师" aria-label="Permalink to &quot;像素画带师&quot;">​</a></h3><p>像素画专家的获得方法:必须要有足够精美细致的像素画才能获得，<strong>_大小不少于 <code>128x128</code> _</strong>，如果足够精美，大小可酌情考虑，方块颜色灵活运用，<strong><em>不能太过于单一</em></strong>。</p>',15)]))}const g=l(o,[["render",r]]);export{m as __pageData,g as default};
